import Link from 'next/link'
const Navbar = () => (
    <nav>
        <ul>
            <li><Link href='/'><a>Home</a></Link></li>
            <li><Link href='/about'><a>About</a></Link></li>
        </ul>
        <style jsx>{`
            ul{
                background-color: #333;
                display:flex;
                list-style: none;
                font-family: sans-serif;
            }
            ul li{
                font-size:18px;
                margin:20px
            }
            ul li a{
                color: #fff;
                text-decoration: none;
            }
        `}
        </style>
    </nav>
)

export default Navbar
